# Generate BRAM Verilog code.
byte_counter = 0

for i in range(1, 31):
    print("""    SB_RAM40_4K #(
      .READ_MODE(2),     // 1024x4
      .WRITE_MODE(2),    // 1024x4""")

    # Rows.
    for k in range(16):
      label = k
      if label == 10:
          label = "A"
      elif label == 11:
          label = "B"
      elif label == 12:
          label = "C"
      elif label == 13:
          label = "D"
      elif label == 14:
          label = "E"
      elif label == 15:
          label = "F"

      # Output wacky, poorly-documented init format.
      print("      .INIT_{0}(256'b".format(label), end='')
      newline = ""
      # Cols.
      for j in range(16):
        b1 = '{:04b}'.format(bytes[byte_counter])
        b2 = '{:04b}'.format(bytes[byte_counter+256])
        b3 = '{:04b}'.format(bytes[byte_counter+512])
        b4 = '{:04b}'.format(bytes[byte_counter+768])
        mixed_byte = ""
        for x in range(4):
            mixed_byte += b4[x] + b3[x] + b2[x] + b1[x]
        byte_counter += 1
        newline = mixed_byte + newline
      print(newline, end='')

      if label == "F":
          print(")")
      else:
          print("),")

    # Move to next 512K segment.
    byte_counter += 768

    print("""    ) ram{0} (
      .RDATA(memory_data_out_{0}),
      .RADDR(raddr),
      .WADDR(waddr),
      .WDATA(memory_data_in),
      .RCLKE(1'b1),
      .RCLK(clk_20mhz),
      .RE(1'b1),
      .WCLKE(1'b1),
      .WCLK(clk_20mhz),
      .WE(write_en{0})
    );
""".format(i))
